import React from 'react';
import classes from './Header.module.css';

import HeaderCartButton from './HeaderCartButton';

const Header = (props) => {
    return (
        <header className={`${classes} ${props.classes}`}>
            {props.info}
            <HeaderCartButton />
        </header>
    );
};

export default Header;
